  return (
    <div>
      <label>enter your name:</label>
      <input type="text" />
      <button style={{ colour: "red", backgroundcolour: "green" }}>
        submit
      </button>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
